import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart is empty and add an item if needed
    const cartCount = await page.textContent('.cart');
    if (parseInt(cartCount) === 0) {
      // Add an item to cart first
      await page.click('.product-card:first-child .add-to-cart');
      await page.waitForTimeout(1000);
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Remove first item from cart
    await page.click('.cart-item:first-child .remove-item');
    await page.waitForTimeout(1000);

    // Verify removal by checking if cart is empty or count decreased
    const updatedCartCount = await page.textContent('.cart');
    const isEmpty = await page.$('.empty-cart');

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_removal.png'));

    return {
      success: true,
      action: "Removed item from cart successfully",
      extractedData: {
        initialCartCount: parseInt(cartCount),
        finalCartCount: parseInt(updatedCartCount),
        cartIsEmpty: !!isEmpty
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
